/*
forms
*/



.welcome {
    margin-left: 400px;
    margin-top: 80px; 
    border-radius: 5px;
    background-color: #f2f2f2;
    color: black;
    width: 40%;
}
input[type=submit] {
    margin-top: 10px;
    background-color: #0099C4;
    padding: 11px 20px;
    border: none;
    border-radius: 4px;
    cursor: pointer;
}
.green input[type=submit]{
    background-color: #0BC474 !important;
}
input[type=text] {
    width: 100%;
    padding: 12px;
    border: 1px solid #ccc;
    border-radius: 4px;
    resize: vertical;
}
input[type=password] {
    width: 100%;
    padding: 12px;
    border: 1px solid #ccc;
    border-radius: 4px;
    resize: vertical;
}
/* Floating column for labels: 25% width */
.col-25 {
  width: 25%;
  margin-top: 6px;
}
/* Floating column for inputs: 75% width */
.col-75 {
  width: 75%;
  margin-top: 6px;
}
footer {
    left: 0;
    bottom: 0;
    position:fixed;
}
@media screen and (max-width: 1024px) {
    .welcome {
        width: 40%;
        margin-left: 70px;
    }
}

@media screen and (max-width: 812px) {
    .welcome {
        margin-left: 50px;
    }
}
